function fetchArray(level) {
    const testArr = [level_easy, level_mid, level_hard].flat(3);
    const newArr = testArr.map(i=> i);
    const finalArray = [];
    let range = 0;

    switch (level) {
        case 'easy':
            newArr.forEach(word => {
                if (word.length < 6) {
                    finalArray.push(word);
                }
            });
            break;
        case 'mid':
            newArr.forEach(word=>{
                if (word.length > 4 && word.length < 8) {
                  finalArray.push(word);
                }
            });
            break;
        case 'mid':
            newArr.forEach(word=>{
                if (word.length > 6) {
                  finalArray.push(word);
                }
            });
            break;
    
        default:
            break;
    }


    return finalArray;
}

